INSERT INTO `servicii` VALUES (4,'Implant dentar',_binary 'data:image/png;base64,','Un implant dentar este confectionat din titan de inalta puritate, material biocompatibil, pe care organismul nostru nu doar ca il accepta, ci il si integreaza prin procesul de osteointegrare, proces prin care osul maxilar/mandibular face corp comun cu implantul.\nAliajele de titan sunt metalele cele mai utilizate pe scara larga n implanturi osoase atat dentare cat si in alte domenii, cum ar fi ortopedia. Implanturile dentare au cea mai mare rata de succes a oricarui dispozitiv implantat chirurgical.\nUn implant dentar are aspectul unui surub cu spire, ce serveste drept inlocuitor al radacinii dintelui lipsa, fiind infiletat in osul mandibulei/maxilarului, obtinandu-se astfel stabilitate si rezistenta.','Ce este implantul dentar?',' De cele mai multe ori, un implant dentar presupune 2 etape, la distanta de 3-6 luni, perioada stabilita in momentul interventiei chirurgicale, in functie de ceea ce hotaraste medicul implantolog. Prima etapa presupune interventia chirurgicala, inserarea implantului in os, etapa ce are loc sub anestezie locala, iar cea de-a doua etapa, dupa 3-6 luni (perioada de osteointegrare, in care implantul face corp comun cu osul), etapa in care se monteaza bontul protetic si se confectioneaza coroana dentara.','Care sunt etapele unui implant dentar?','Orice persoana careia ii lipsesc unul sau mai multi dinti si care nu vrea ca spatiul edentat sa afecteze si restul dintilor sanatosi poate beneficia de un implant dentar.Nu exista o limita de varsta pentru pacientii carora le poate fi de folos un implant dentar, atata timp cat sunt clinic sanatosi. Exista studii facute conform carora, daca pacientul este suficient de sanatos incat sa i se extraga un dinte, poate face fata cu brio si unei interventii de inserare a unui implant dentar in os.','Cine poate beneficia de un implant dentar?','Inserarea unui implant dentar in os se face intotdeauna sub anestezie locala, fapt ce asigura pacientului un confort sporit si nicio durere in timpul interventiei. Dupa ce va trece anestezia, daca se respecta intocmai indicatiile postoperatorii date de medic (vezi indicatii postoperatorii) pacientul nu va intampina nicio dificultate in a-si desfasura in continuare activitatile zilnice.','Este dureroasa interventia?','Un implant dentar este confectionat din titan de inalta puritate, material biocompatibil, pe care organismul nostru nu doar ca il accepta, ci il si integreaza prin procesul de osteointegrare, proces prin care osul maxilar/mandibular face corp comun cu implantul','implantologie');
INSERT INTO `servicii` VALUES (5,'Aditie os',_binary 'data:image/png;base64,','Pentru aditia osoasa se folosesc o gama larga de materiale de aditie, denumite generic biomateriale (materiale fara viata, utilizate in domenii medicale, cu scopul de a produce o interactiune cu sistemul biologic -Wagner, 1991)\nAceste biomateriale trebuie sa intruneasca o conditie esentiala, anume, sa fie biocompatibile din punct de vedere biologic, mecanic si functional si sa produca doar reactii pozitive, fara sa determine reactii de aparare din partea organismului viu care primeste inserat in intimitatea lui un material strain.','La ce se refera biocompatibilitatea?','In functie de interventia chirurgicala in cadrul careia se face aditia osoasa, etapele difera:\n aditie osoasa postextractionala: medicul chirurg face anestezia locala, extrage dintele, chiureteaza (curata) alveola de tesuturile moi si pungile de infectie, spala cu ser fiziologic, aditioneaza os in alveola, inchide cu membrana resorbabila (daca este cazul) si sutureaza;\n\n aditie osoasa in cazurile de boala parodontala: medicul incepe cu igienizarea si asanarea cavitatii orale (detartraj, periaj profesional, air flow), urmate de un chiuretaj subgingival profund. Dupa chiuretaj, se spala cu ser fiziologic, se separa gingia de jur imprejurul dintilor, se aditioneaza os si se sutureaza;','Ce implica aceasta procedura?','','Cine poate beneficia de un implant dentar?','','','Aditia osoasa este procedura chirurgicala menita sa refaca pierderea de masa osoasa cauzata de extractiile dentare, boala parodontala, traumatisme, proteze mobile neadaptate corespunzator.','implantologie');
INSERT INTO `servicii` VALUES (6,'Coroane dentare',_binary 'data:image/jpeg;base64,','pentru protejarea unui dinte slab (cu tratamente deja efectuate) de la rupere;\n pentru a restaura un dinte deja rupt/fracturat;\n pentru a acoperi si a sustine un dinte ce are 3/4 obturatii fizionomice;\n pentru a acoperi dintii cu o coloratie urata;\n pentru a acoperi un implant dentar;\n pentru a restaura estetic zambetul.','Cand este necesara o coroana dentara?','Zirconiul este un material foarte puternic, biocompatibil cu organismul uman. Zirconiul este folosit in numeroase aplicatii din medicina, cum ar fi articulatiile artificiale.','Coroana de zirconiu','  biocompatibilitatea cu organismul uman elimina riscul oricarei reactii alergice;\n aspect translucid, natural;\n rezistenta mult mai mare ca in cazul coroanelor metalo-ceramice;\n mult mai fidela, dintele necesita foarte putin prelucrat (slefuit);\n nu sunt sensibile la variatiile de temperatura\n nu se fractureaza\n nu exista riscul aparitiei cariilor;\n fiind de culoare alba, atunci cand gingiile se retrag, nu mai exista nicio problema la nivel estetic.','Avantaje','','','Anatomia unui dinte se compune din radacina si coroana. Radacina dintelui este acoperita de os si gingii. Partea dintelui care este vizibila in gura, deasupra gingiilor, se numeste coroana clinica.','proteze dentare');
INSERT INTO `servicii` VALUES (7,'Proteze dentare fixe',_binary 'data:image/jpeg;base64,','    proteze dentare fixe unidentare (coroane dentare individuale);\n  punti (proteze dentare fixe ce inlocuiesc mai multi dinti lipsa, lucrari ce se sprijina pe cel putin 2 dinti stalpi);','Protezele dentare fixe pot fi:','  aceste proteze dentare fixe sunt amplasate definitiv la nivelul dintilor restanti sau pe implanturi dentare;\n grad sporit de confort;\n volum aproximativ egal cu al dintilor restaurati;\n au sprijin parodontal si/sau osos;\n potential mult mai bun de integrare morfo-functionala\n cu ajutorul acestor proteze dentare fixe veti avea parte de un aspect natural al dintilor.','Avantaje:',' metal;\n acrilat;\n metalo-ceramica total fizionomica;\n metalo-ceramica semifizionomica;\n integral ceramica;\n metalo-compozit semifizionomic;\n metalo-compozit total fizionomic\n proteze dentare fixe din ceramica pe suport de zirconiu.','Protezele dentare fixe pot fi realizate din:','','','Protetica dentara fixa studiaza metodele si tehnicile de protezare cu ajutorul lucrarilor protetice fixe (proteze dentare fixe)\"','proteze dentare'),(8,'Proteze dentare mobile',_binary 'data:image/jpeg;base64,','Protezele Dentare sunt lucrari dentare mobile ce tin locul dintilor si ajuta aparatul dento-maxilar in restabilirea functiilor masticatorii. Proteza dentara are rolul redarii cat mai anatomic si cat mai natural trasaturile, zambetul si aspectul placut.\nProtezele dentare se pot clasifica in proteze mobile, totale si partiale','Ce Inseamna Proteza Dentara ?',' De proteze dentare mobile pot beneficia persoanele cu edentatii mari sau totale, persoane cu un deficit osos foarte mare.','Cine poate beneficia de proteze mobile?','  imbunatatirea masticatiei, vorbirii si digestiei.\n imbunatatirea zambetului, redarea aspectului placut al buzelor, intinderea pielii fetei la un nivel normal;\n recapatarea increderii in sine, imbunatatirea relatiilor interpersonale;','Avantaje:','Protezele dentare mobile totale sunt necesare atunci cand edentatia este totala (nu mai exista niciun dinte).','Proteza dentara totala acrilica','Protezele Dentare sunt lucrari dentare mobile ce tin locul dintilor si ajuta aparatul dento-maxilar in restabilirea functiilor masticatorii. Proteza dentara are rolul redarii cat mai anatomic si cat mai natural trasaturile, zambetul si aspectul placut.','proteze dentare'),(9,'Punti dentare',_binary 'data:image/jpeg;base64,','-ceramica;\n zirconiu;\n acrilat;\n compozit','Care sunt materialele din care sunt confectionate puntile dentare?','In general puntea dentara poate avea o durata de 5-7 ani, iar daca este respectata o buna igiena orala si daca pacientul merge regulat la medicul dentist (pentru profilaxie, pentru verificarea dintilor stalpi de sub lucrare), poate dura si peste 10 ani.','Cat timp dureaza o punte dentara?','  igiena dentara corecta (periaj, apa de gura, ata dentara, dus bucal);\n curatarea zilnica sub dintii falsi;\n folosirea atei dentare in special intre dintele stalp al lucrarii si restul dintilor naturali;\n consumul de alimente moi sau taiate in bucati mici pentru perioada de inceput, pana va obisnuiti cu noua lucrare;','Cum trebuie sa am grija de puntea dentara?','','','Puntea dentara este restaurarea dentara fixa folosita pentru a inlocui un dinte lipsa cu unul fals, ancorat pe dintii vecini cu ajutorul unor coroane dentare','proteze dentare'),(10,'Albire dentara',_binary 'data:image/jpeg;base64,',' Orice persoana care isi doreste sa aiba un zambet mai alb si mai stralucitor poate beneficia de albirea dentara. Medicul dentist va evalua sanatatea orala si va recomanda metoda de albire si cantitatea de peroxid folosita poentru fiecare pacient in parte.','Sunt un bun candidat pentru albirea dentara?',' Albirea dentara nu este recomandata persoanelor care au obturatii fizionomice (plombe) sau coroane dentare pe dintii din fata, deoarece vor exista diferente de culoare vizibile intre dintii albiti si coroanele dentare si obturatiile fizionomice (care nu isi mai schimba culoarea).\nDintii care sunt galbeni raspund cel mai bine la tratamentul de albire.\nDintii maro, gri, cei cu dungi sau pete de tetraciclina sau prea mult fluor nu se vor albi uniform.\nPersoanele cu boli parodontale sau dinti deosebit de sensibili pot evita tratamentul de albire profesionala, deoarece atat in timpul lui, cat si dupa, vor simti durere.','Caror persoane le este contraindicata albirea dentara?',' Astazi, procedeul de albire dentara in cabinet, sub stricta observatie a medicului dentist este foarte sigura. Medicul adapteaza concentratia gelului de albit, puterea laserului sau a lampii, timpul necesar albirii in functie de rezultatul dorit de pacient.','Cat de sigura este albirea dentara? Imi afecteaza dintii?','Procedeul de albire facut de un medic specialist in estetica dentara nu poate avea loc inainte de a se face o igienizare completa a intregii guri (vezi profilaxia).\n            In general, intregul proces are loc in doua etape. In prima sedinta se face profilaxia, urmand ca in cea de-a doua intalnire sa sa faca albirea propriu zisa, nu dureaza mai mult de 60-90 minute. Medicul sigileaza gingia cu un material special (o diga) pentru a nu fi afectata, iar dupa aceea aplica gelul de albire, se pun ochelarii de protectie pacientului si se porneste laserul/lampa.\n        Din cand in cand se opreste laserul/lampa si medicul verifica nuanta la care s-a ajuns. In 60-90 de minute va puteti bucura de zambetul alb stralucitor mult dorit.','Cat dureaza tratamentul si ce presupune?','Albirea dentara este o procedura comuna in stomatologia generala, dar mai ales in estetica dentara, prin faptul ca reda culoarea naturala a dintilor, sau, dupa preferinte, schimba cu pana la 5-7 nuante culoarea dintilor naturali.','estetica dentara'),(11,'Fatete dentare veneers',_binary 'data:image/jpeg;base64,','  dinti care sunt ciobiti sau sparti;\n dinti care au spatii intre ei (pentru a inchide spatiul);\n dinti care sunt inegali (ca lungime sau grosime) sau cu forme neregulate;\n dinti care sunt decolorati, fie din cauza tratamentelor de canal, petelor de tetraciclina sau a altor cauze;','Ce tipuri de probleme rezolva fatetele Veneers?','Intre 5 si 10 ani, depinzand insa de modul dvs. de viata. Pentru ca fatetele sa dureze cat mai mult, trebuie sa urmati un program de igiena orala si vizite regulate la medicul dentist. De asemenea, trebuie sa aveti grija la modul cum consumati alimentele. Trebuie sa va autodisciplinati in ceea ce priveste felul cum mancati: exclus sa mai muscati din fructe sau alimente tari, totul trebuie taiat in bucati.','Cat timp voi beneficia de fatetele Veneers?','','','','','Fatetele dentare sunt lucrari subtiri de portelan, folosite pentru a recrea aspectul natural al dintilor, oferind in acelasi timp puterea si rezistenta smaltului dintilor naturali.','estetica dentara'),(16,'Implant dentar',_binary 'data:image/jpeg;base64,','Un implant dentar este confectionat din titan de inalta puritate, material biocompatibil, pe care organismul nostru nu doar ca il accepta, ci il si integreaza prin procesul de osteointegrare, proces prin care osul maxilar/mandibular face corp comun cu implantul.\nAliajele de titan sunt metalele cele mai utilizate pe scara larga n implanturi osoase atat dentare cat si in alte domenii, cum ar fi ortopedia. Implanturile dentare au cea mai mare rata de succes a oricarui dispozitiv implantat chirurgical.\nUn implant dentar are aspectul unui surub cu spire, ce serveste drept inlocuitor al radacinii dintelui lipsa, fiind infiletat in osul mandibulei/maxilarului, obtinandu-se astfel stabilitate si rezistenta.','Ce este implantul dentar?',' De cele mai multe ori, un implant dentar presupune 2 etape, la distanta de 3-6 luni, perioada stabilita in momentul interventiei chirurgicale, in functie de ceea ce hotaraste medicul implantolog. Prima etapa presupune interventia chirurgicala, inserarea implantului in os, etapa ce are loc sub anestezie locala, iar cea de-a doua etapa, dupa 3-6 luni (perioada de osteointegrare, in care implantul face corp comun cu osul), etapa in care se monteaza bontul protetic si se confectioneaza coroana dentara.','Care sunt etapele unui implant dentar?','Orice persoana careia ii lipsesc unul sau mai multi dinti si care nu vrea ca spatiul edentat sa afecteze si restul dintilor sanatosi poate beneficia de un implant dentar.Nu exista o limita de varsta pentru pacientii carora le poate fi de folos un implant dentar, atata timp cat sunt clinic sanatosi. Exista studii facute conform carora, daca pacientul este suficient de sanatos incat sa i se extraga un dinte, poate face fata cu brio si unei interventii de inserare a unui implant dentar in os.','Cine poate beneficia de un implant dentar?','Inserarea unui implant dentar in os se face intotdeauna sub anestezie locala, fapt ce asigura pacientului un confort sporit si nicio durere in timpul interventiei. Dupa ce va trece anestezia, daca se respecta intocmai indicatiile postoperatorii date de medic (vezi indicatii postoperatorii) pacientul nu va intampina nicio dificultate in a-si desfasura in continuare activitatile zilnice.','Este dureroasa interventia?','      Despre implant dentar se istorisea inca de pe vremea mayasilor (sec. VII), insa a devenit cunoscut abia prin anii 60 ca metoda de a inlocui un dinte/un grup de dinti absenti.      Din cauza lipsei de informare si a costurilor ridicate, Romania a inceput sa practice restaurarea cavitatii orale cu implant dentar abia in ultimii 5-7 ani, fapt ce reprezinta o evolutie pozitiva atat in cresterea standardelor tratamentelor, cat si in imbunatatirea sanatatiii orale.','implantologie');
